import styles from './style.module.scss';
const Article = (props) => {
    const { schema } = props;
    const { children } = schema;
    return (
        <div className={`wrapper ${styles.ArticleWrapper}`}>
            <ul className={styles.list}>
                {
                    children.map((item) => {
                        console.log(item);
                        return (
                            <li>
                                <img alt='img' src='https://blog-project-static-file.oss-cn-hangzhou.aliyuncs.com/images/article.jpg'></img>
                                <h2 className={styles.title}>标题</h2>
                                <p className={styles.desc}>
                                    SASS是一种CSS的开发工具，提供了许多便利的写法，大大节省了设计者的时间，使得CSS的开发，变得简单和可维护。
                                    本文总结了SASS的主要用法。我的目标是，有了这篇文章，日常的一般使用就不需要去看官方文档了。
                                </p>
                            </li>
                        )
                    }

                    )
                }
            </ul>
        </div>

    )
}

export default Article;
